function extraer_poblacion(country){
var l = [];

for (var i in data_pop){
  var upper = data_pop[i]["Country Name"].toUpperCase();
  if (upper == country) {
    for (j = 1960; j <= 2016; j++) {
      l.push(data_pop[i][j])
    }
  };
}
return l;
}
